import React from 'react';
import { useNavigate } from 'react-router-dom';

const Contact = () => {
	let navigate = useNavigate();

	const [getFname, setFname] = useState('');
	const [getLname, setLname] = useState('');
	const [getEmail, setEmail] = useState('');
	const [getAddress, setAddress] = useState('');
	const [getSubject, setSubject] = useState('');

	useEffect(() => {
		Axios.get('http://localhost:3001/get').then((response) => {
			setUserlist(response.data);
		});
	}, []);

	const handleSubmit = (e) => {
		e.preventDefault();
		Axios.post('http://localhost:3001/insert', {
			username: getUser,
			password: getPass,
		}).then((response) => {
			alert('Insert Successfully');
		});
	};

	return (
		<div>
			<div>
				<br /> <br /> <br />
				<div className='body1'>
					This is our Contact Information <br />
					Please reach us @www.burgernbite.com <br />
					Contact us with: 000123456
				</div>
				<br />
				<br />
				<div className='container1'>
					<div className='cl'>
						<h2>Contact Form</h2>
					</div>
<form>
<div className='form-body'>
						<div className='username'>
							<label className='form__label' for='firstName'>
								First Name{' '}
							</label>
							<input
								className='form__input'
								type='text'
								id='firstName'
								placeholder='First Name..'
							/>
						</div>
						<div className='lastname'>
							<label className='form__label' for='lastName'>
								Last Name{' '}
							</label>
							<input
								type='text'
								name=''
								id='lastName'
								className='form__input'
								placeholder='LastName'
							/>
						</div>
						<div className='email'>
							<label className='form__label' for='email'>
								Email{' '}
							</label>
							<input
								type='email'
								id='email'
								className='form__input'
								placeholder='Email..'
							/>
						</div>
						<div className='address'>
							<label className='form__label' for='address'>
								Address{' '}
							</label>
							<input
								type='text'
								name=''
								id='address'
								className='form__input'
								placeholder='Address..'
							/>
						</div>
						<div className='subject'>
							<label className='form__label' for='subject'>
								Subject
							</label>
							<input
								type='text'
								name=''
								id='subject'
								className='form__input'
								placeholder='Write something..'
							/>
						</div>
					</div>
					<br />
					<div class='footer'>
						<button type='submit' class='btn btn-dark'>
							Submit
						</button>
					</div>
</form>

				</div>
				<br />
				<button
					type='button'
					className='bt1'
					onClick={() => {
						navigate('/');
					}}
				>
					Back to Homepage
				</button>
			</div>
		</div>
	);
};

export default Contact;
